import React from 'react';
// Header 컴포넌트 정의
function Header() {
  const style = {
    backgroundColor: '#D4D2E3',
    color: 'black',
  };
  return (
    <header>
      <div>
        <h3 style={style}>BALANCETALK</h3>
      </div>
    </header>
  );
}

export default Header;
